import React from 'react'

function Profile(name, age, profilePic) {
  return (
    <div class="profile__info">
      <Avatar className='chat__image' alt={name} src={profilePic}/>
      <h2>{name}, {age}</h2>
    </div>

  )
}

export default Profile;
